Medieval English lords held significant power over the peasants who worked their land.  The feudal system was hierarchical, with lords holding land granted by the monarch, and peasants tied to that land.  Peasants were obligated to work the lord's land and provide him with a portion of their produce in exchange for protection and the right to cultivate a small portion of land for their own sustenance. This system inherently lacked the principles of fair trade, such as equitable compensation and voluntary exchange.  Peasants had limited bargaining power and were essentially subject to the lord's demands.

